import logo from "../images/logo.png"
function Header(){
  return (
    <header>
      <section style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
        <div>
        <img src={logo} alt="logo"/>
        </div>
        <div>
          Little Lemon Restaurants
        </div>
      </section>
    </header>
  );
};
export default Header;
